import React from "react";
import custom from "./images/custom.jpeg";

const KeepHeader = () => {
    return (
        <>
            <header>
                <img src = {custom} alt= "keepLogo"/>
                <h1>Tarun Kushwaha</h1>
            </header>
        </>
    );
}

export default KeepHeader;
